INSERT INTO `copy` VALUES ('364', '242', '2015年8月29日，十二届全国人大常委会十六次会议表决通过刑法修正案（九）。', 'https://baike.baidu.com/item/刑法', '0', '38');
INSERT INTO `copy` VALUES ('365', '242', '修改后的刑法自2015年11月1日开始施行。这也是继1997年全面修订刑法后通过的第九个刑法修正案。', 'https://baike.baidu.com/item/刑法', '39', '88');
INSERT INTO `copy` VALUES ('366', '242', '有广义与狭义之分。广义刑法是一切刑事法律规范的总称，狭义刑法仅指刑法典，在我国即《', 'https://baike.baidu.com/item/刑法', '108', '148');
INSERT INTO `copy` VALUES ('367', '242', '中华人民共和国刑法》。', 'https://baike.baidu.com/item/刑法', '149', '159');
INSERT INTO `copy` VALUES ('368', '242', '与广义刑法、狭义刑法相联系的，刑法还可区分为普通刑法和特别刑法。普通刑法指具有普遍使用效力的刑法，实际上即指刑法典。特别刑法指仅使用于特定的人、时、地、事（犯罪）的刑法。在我国，也叫', 'https://baike.baidu.com/item/刑法', '160', '250');
