INSERT INTO `copy` VALUES ('381', '249', '2015年7月1日，第十二届全国人民代表大会常务委员会第十五次会议通过新的国家安全法。国家主席习近平签署第29号主席令予以公布。法律对政治安全、国土安全、军事安全、文化安全、科技安全等11个领域的国家安全任务进行了明确，共7章84条，自2015年7月1日起施行。', 'https://baike.baidu.com/item/安全法', '0', '130');
INSERT INTO `copy` VALUES ('382', '249', '华人民共和国国家安全法，是为了维护国家安全，保卫人民民主专政的政权和中国特色社会主义制度，保护人民的根本利益，保障改革开放和社会主义现代化建设的顺利进行，实现中华民族伟大复兴，根据《', 'https://baike.baidu.com/item/安全法', '132', '222');
INSERT INTO `copy` VALUES ('383', '249', '中华人民共和国宪法》，制定的法规。', 'https://baike.baidu.com/item/安全法', '223', '239');
